import { connect } from "react-redux"
import { Link } from "react-router-dom"
import hongo_logo from "assets/images/mushroom.png"
function Navbar() {
    return (
        <div className="bg-white px-3 py-2 sm:px-3">
            <div className="-ml-4 -mt-2 flex flex-wrap items-center justify-between sm:flex-nowrap md:px-12 px-2">
                <div className="ml-4 mt-2">
                    <img
                    src={hongo_logo}
                    width={33}
                    height={27}
                    className=""/>
                </div>
                <div className="ml-4 mt-2 flex-shrink-0">
                    <Link to='/nosotros' className="text-lg inline-flex font-medium leading-6 text-gray-900 mx-6">Sobre Nosotros</Link>
                    <Link to='/platillos' className="text-lg inline-flex font-medium leading-6 text-gray-900 mx-6">Platillos</Link>
                    <Link to='/bebidas' className="text-lg inline-flex font-medium leading-6 text-gray-900 mx-6">Bebidas y Snacks</Link>
                    <button
                        type="button"
                        className="ml-12 relative inline-flex items-center rounded-md border border-transparent bg-blue-600 px-6 py-3 text-md font-bold text-white shadow-sm hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-offset-2"
                    >
                        Quiero Probarlo!
                    </button>
                </div>
            </div>
        </div>
    )
}
const mapStateToProps = state => ({

})
export default connect(mapStateToProps, {

})(Navbar)
